&bull; However, you must always perform server-

&ndash; JavaScript can be bypassed
&ndash; Input sanitization

&ndash; Web storage: client-side sessions, to allow separate instances of the same
web app to run in different windows without interfering with each other
&ndash; Traditional cookies: communication with server
&bull; When you open a page, it scans the computer for a user-key.
&ndash; If there is a match, it accesses that session
&ndash; If not, it starts a new session
&bull; Session data is not saved in the cookie, just the session ID
&bull; Session data is stored server-side
&ndash; You might recall $_SESSION from PHP:
&bull; $_SESSION["favanimal"] = "cat";
&ndash; In Node/Express, you need to add an appropriate store to manage this data
&bull; The most popular is Redis
&ndash; Officially, Redis is not supported on Windows, but you can still install it:
https://redislabs.com/blog/redis-on-windows-8-1-and-previous-versions/

&bull; Session.destroy(callback);
&ndash; Destroys the session and will unset the req.session property.
&ndash; Once complete, the callback will be invoked.
&ndash; Example:
app.post("/logout", function (req, res){
req.session.destroy( function (err) {
if(err) return console.log(err);
res.send("You have been logged out.");
});
});

</script><script type="text/html" data-path="presentation/c1b77afdf817e392070fda0a9eea1e19bf70570c-1584982808933/textfiles/slide-15.txt">&bull; The HTTP protocol is stateless
&ndash; originally only static pages were served upon request
&bull; With the development of personalization, in order to maintain
information on the server about state (authentication, number of
visits, preferences&hellip;), cookies were created
&bull; They are a mechanism for servers to both store and retrieve
information on the client-side, until they expire
&bull; A server can send cookies to the client
&ndash; If the browser accepts it, it is stored as plain text
&ndash; Then, in subsequent visits, the browser sends the same cookie to the server.
&bull; A cookie can also be created by client-side JavaScript; if so, it can
be read/written to by the client, as well as by the server
&ndash; document.cookie = "key1=value1;key2=value2;expires=date";
&ndash; when you read the cookie , you can only see the key=value bits
&ndash; it works as a String that you can append more key=value(s) to
HTTP Cookies

&bull; The default cookie settings are { path: '/', httpOnly: true,

npm install express-session

app.use(session({

}));

&bull; Cookie parameters (all optional except the last):
&ndash; Expires: The date the cookie will expire. If this is blank, the
cookie will expire and be deleted when the visitor closes the
browser: a session cookie
&bull; when Chrome or Firefox are configured to reopen tabs from
last time upon start, they will keep session cookies when
closing the browser, making them act as persistent cookies
&ndash; Domain: The domain name of the website.
&ndash; Path: The path to the directory or web page that set the cookie.
By default it is '/' , so you can retrieve the cookie from any
directory or page.
&ndash; Secure: If the cookie contains the word "Secure", the cookie
may only be retrieved with a secure server (HTTPS).

</script><script type="text/html" data-path="presentation/c1b77afdf817e392070fda0a9eea1e19bf70570c-1584982808933/textfiles/slide-18.txt">Cookies
&ndash; Secure: If the cookie contains the word "Secure", the cookie
may only be retrieved with a secure server (HTTPS).
&ndash; HttpOnly: directs browsers not to expose cookies through
channels other than HTTP (and HTTPS) requests, and thus not
accessible via JavaScript (using document.cookie)
&ndash; Name=Value: cookies have the form of key and value pairs.
Values may not include semicolons, commas, or whitespace.
&bull; Browsers do not send the cookie attributes back to the server, just
name and value.
&bull; The attributes are used by the browser to determine when to
delete a cookie, accept or block a cookie, etc.
&bull; Beware of the EU Cookie Laws and GDPR!
&ndash; Requires asking permission from users before planting cookies, and
including details on their purpose.
